import React from 'react';

const Portfolio = () => {
  return (
    <section id="portfolio">
      <h2>Портфоліо</h2>
      <p>Ознайомтеся з нашим портфоліо, щоб переконатися в якості наших робіт. Ми горді кожним звуковим шедевром, який ми створюємо.</p>
    </section>
  );
};

export default Portfolio;
